import React from 'react';
const Header = () => {
    return(
        <>
       <nav className="navbar navbar-dark bg-light">
  <div className="container-fluid">
    <a className="navbar-brand" href="#">
       Gourav info!
    </a>
  </div>
</nav>
        </>
    )

}
export default Header;
